// SPDX-License-Identifier: MIT
// ERC721A Contracts v3.3.0
// Creator: Chiru Labs

pragma solidity ^0.8.4;


import '@openzeppelin/contracts/utils/math/SafeMath.sol';


contract ERC721A  {
    using SafeMath for uint;
    



    uint256 private _K;

    uint256 internal _startBlockNumber;
 
    /**
     *[user][1] = last_block
     *[user][2] = accumulation_power   
     *[user][3] = accumulation_DCF    
    */   
    mapping(address => mapping(uint256 => uint256))private _mineInfo;      
    

    constructor() {       
        _K = uint256(1500000).mul(80000000e18);  
        _startBlockNumber = block.number;         
    }



    function MineStatus(address user)public view returns(uint256){           
        uint256 start = blockStatus(_mineInfo[user][1]);
        uint256 end = blockStatus(block.number);       
        uint dcf_amount = start.sub(end);     
        return _mineInfo[user][3].add(dcf_amount);       
    }
   

    // The number of DCF that can be mined in this Block
    function blockStatus (uint256 _BlockNumber)public view returns (uint256){
        if(_BlockNumber < _startBlockNumber){
            _BlockNumber = _startBlockNumber;
        }
        uint256 a = _BlockNumber.sub(_startBlockNumber).add(1500000);
        uint256 b = _K.div(a);
        return b;
    }



   
}

